import React, { FC, useMemo } from 'react';
import { Figure } from '../../models/figure';

interface Props {
    title: string;
    figures: Figure[];
}

const LostFigures: FC<Props> = ({title, figures}) => {
    const lostFigures = useMemo(() => {
        return (
            <div>
                {figures.map(figure => (
                    <span key={figure.id}>
                        {figure.name}

                        {figure.logo && <img src={figure.logo} alt=""/>}
                    </span>
                ))}
            </div>
        )
    }, [figures]);

    return (
        <div className="lost">
            <p>{title}</p>

            {lostFigures}
        </div>
    )
}

export default LostFigures;
